export const getParticipantsNumber = (layout) => {
  const image = images.find((img) => img.layout === layout);
  return image ? image.participantsNumber : null;
};

export const getSelectedLayoutName = (layout) => {
  const image = images.find((img) => img.layout === layout);
  return image ? image.layoutName : null;
};

export const getNewPresenterLayout = (participantsNumber) => {
  const sortedImages = [...images].sort(
    (a, b) => a.participantsNumber - b.participantsNumber
  );
  const image = sortedImages.find(
    (img) => img.participantsNumber >= participantsNumber
  );
  return image ? image.layout : null;
};

